css:
.rspec-spinner {
  margin: auto;
  margin-top: 20px;
  background-image: url(images/octocat-spinner-128.gif);
  background-repeat: no-repeat;
  background-size: 64px;
  background-position: top center;
  padding-top: 70px;
  text-align: center;
}
.rspec-console.rspec {
  background-color: black;
  color: white;
  overflow: scroll;
}
.rspec-console.rspec pre,
.rspec-console.rspec pre div atom-text-editor,
.rspec-console.rspec code,
.rspec-console.rspec tt {
  font-size: 12px;
  font-family: Consolas, "Liberation Mono", Courier, monospace;
}
.rspec-console.rspec pre a {
  color: #0099cc;
}
.rspec-console.rspec .rspec-output {
  background: #000;
  color: #fff;
}
.rspec-console.rspec .rspec-output .rspec-color {
  display: inline-block;
  padding: 0;
  margin: 0;
}
.rspec-console.rspec .rspec-output .tty-30 {
  color: black;
}
.rspec-console.rspec .rspec-output .tty-31 {
  color: red;
}
.rspec-console.rspec .rspec-output .tty-32 {
  color: green;
}
.rspec-console.rspec .rspec-output .tty-33 {
  color: yellow;
}
.rspec-console.rspec .rspec-output .tty-34 {
  color: blue;
}
.rspec-console.rspec .rspec-output .tty-35 {
  color: magenta;
}
.rspec-console.rspec .rspec-output .tty-36 {
  color: cyan;
}
.rspec-console.rspec .rspec-output .tty-37 {
  color: white;
}
.rspec-console.rspec .stderr {
  color: red;
}
.rspec-console.rspec .stdout {
  color: white;
}
